.thumb


	/* ------------------------------- Rotary Config ---------------------------------------------*/
	
	.equ Radios,			120	  @ Radio number of image
	.equ LPTMR0_CMR_INIT,	20   @ Delay between radios
	
	/*--------------------------------------------------------------------------------------------*/
	
	
	
	
	/*------------------------------------- Labels -----------------------------------------------*/
	

	/* Clock enable, port  A, Port B, and LPTMR */
	
	.equ SIM_SCGC5,		0x40048038
	.equ SIM_SCGC5_INIT,	0xc01
	
	
	/* Configure pins port_C[0:15] and Port_B[16:23] as GPIO, Drive Strength */
	 
	.equ PORTC_GPCLR, 		0x4004B080 
	.equ PORTC_GPCLR_INIT,  0xFFFF0140
	
	.equ PORTB_GPCHR, 		0x4004A084 
	.equ PORTB_GPCHR_INIT,	0xFF0140
		
	.equ PORTC_PCR16		,0x4004B040
	.equ PORTC_PCR16_INIT	,0x1090102
	
	
	/* Enable port B, port C, as output and PORT C 16 as Input */
	
	.equ GPIOC_PDDR ,		0x400FF094
	.equ GPIOC_PDDR_INIT ,	0x0FFFF
	
	.equ GPIOB_PDDR , 		0x400FF054 
	.equ GPIOB_PDDR_INIT, 	0x00FF0000
	
	
	/* Clock with bypass */
	
	.equ  LPTMR0_PSR,		0x40040004 
	.equ LPTMR0_PSR_INIT ,	0x4					/* 32K Clock */
	@.equ  LPTMR0_PSR_INIT,	0x5					/* 1K Clock*/	
	
	
	/* LPTMR comparer*/
	
	.equ LPTMR0_CMR,		0x40040008 
		
	
	/* LPTMR as cycle counter, and enable interruptions*/
	
	.equ LPTMR0_CSR,		0x40040000 
	.equ LPTMR0_CSR_ON,	 	0xC1
	.equ LPTMR0_CSR_OFF,	0xC0
	
	
	/* Enable 32Khz Clock*/
	
	.equ MCG_C1          ,  0x40064000
	.equ MCG_C1_INIT     ,  0x6
	
	
	/* Adrress for clear and enable NVIC */
	
	.equ NVICICPR1,		 	0xE000E284 
	.equ NVICISER1,		 	0xE000E104 
	
	
	/* Masks for clear interruptions*/
	
	
	.equ IRQ61Mask		 	,0x20000000 	/* Hall interruption */
	.equ IRQ58Mask		 	,0x04000000		/* LPTMR Interruption */ 	
	.equ IRQAll,			0x24000000		/* All Interruptions */
	
		
	/* Adresses to write PORT_C and PORT_B */
	
	.equ GPIOC_PDOR,		0x400FF080
	.equ GPIOB_PDOR,		0x400FF040
	
	
	
	
	
	/* ---------------------------------- Program variables --------------------------------------*/
	
	 .data
	 .align 2 	
	 	 
	 RadioActual: 				.word 		0b1 
	 Flag_LPTMR:				.word    	0x0			
	 Flag_Hall:					.word      	0x0			
	 Vueltas:					.word       0x0
	 
	/* -------------------------------------------------------------------------------------------*/
	
	
 
