	/*------------------------------------------ Main code ------------------------------------------------*/
	
	
.text
.align 2	
.global	main
.type main function


	
main:

	/* The values of the previous variables are initialized */	 


	LDR r0,=RadioActual
	LDR r1,=#0
	STR r1,[r0]
	

	/* The values of the previous labels are initialized */


	/* CLOCK PORTS */

	LDR r0,=SIM_SCGC5
	LDR r1,=SIM_SCGC5_INIT
	STR r1,[r0]
	
	
	/* PORTS CONFIGURATION */
	
	LDR r0,=PORTC_GPCLR
	LDR r1,=PORTC_GPCLR_INIT
	STR r1,[r0] 
	
	LDR r0,=PORTC_PCR16
	LDR r1,=PORTC_PCR16_INIT
	STR r1,[r0] 
	
	LDR r0,=PORTB_GPCHR
	LDR r1,=PORTB_GPCHR_INIT
	STR r1,[r0] 
	
	
	/* PORTS INPUT OR OUTPUT */
	
	LDR r0,=GPIOC_PDDR
	LDR r1,=GPIOC_PDDR_INIT
	STR r1,[r0] 
	
	LDR r0,=GPIOB_PDDR
	LDR r1,=GPIOB_PDDR_INIT
	STR r1,[r0]
	
		
	/* MCG CONFIG */
	
	ldr r0,=MCG_C1
	ldr r1,=MCG_C1_INIT
	strb r1,[r0]
	
	/* LPTMR CONFIG */
	
	LDR r0,=LPTMR0_CMR 			
	LDR r1,=LPTMR0_CMR_INIT
	STR r1,[r0] 
	
	LDR r0,=LPTMR0_PSR
	LDR r1,=LPTMR0_PSR_INIT		
	STR r1,[r0] 
	

		
	
	/* NVIC CONFIG */
			
 	LDR r0,=NVICICPR1
 	LDR r1,=IRQAll
 	STR r1,[r0]
	
	
	LDR r0,=NVICISER1
 	LDR r1,=IRQAll
 	STR r1,[r0]	
 	
 	
 	LDR r8,=Image1
 	
	
	/*------------------------------------------ Main Loop -------------------------------------------*/

	
MainLoop:

	LDR r2,=Flag_Hall
	LDR r3,[r2]
	CMP r3,#1
	
	IT EQ
	BEQ Hall
	
	LDR r2,=Flag_LPTMR
	LDR r0,[r2]
	CMP r0,#1			
	
	IT EQ
	BEQ LPTMR
	
	B Sleep
	
	
	
/*--------------------------Hall Sensor subroutine------------------------*/

Hall:
	
		
	LDR r0,= Flag_Hall			/* Reset Flag_Hall*/
	LDR r1,=#0
	STR r1,[r0]	
	
	LDR r0,=LPTMR0_CSR			/* disable LPTMR*/
	LDR r2,=LPTMR0_CSR_OFF		
	STR r2,[r0]
	
		
	LDR r0,= Flag_LPTMR			/* clear Flag_LPTMR*/
	LDR r1,=#0
	STR r1,[r0]
							
	LDR r0,=LPTMR0_CMR	
	LDR r1,[r0]				
	
	 
	 
	LDR r0,=RadioActual
	LDR r2, [r0]

	
	LDR r0,=Radios		
	MUL r1,r2					/* Calculate the new value of the lptmr comparator */
	UDIV r1,r0
	ADD r1,#1
		

	LDR r0,=LPTMR0_CMR			/* Change Value of LPTMR CMR */
	STR r1,[r0]					
	
	
	LDR r0,=LPTMR0_CSR			/* Enable LPTMR*/
	LDR r2,=LPTMR0_CSR_ON		
	STR r2,[r0]
	

	LDR r0,=RadioActual
	LDR r1,=1
	STR r1,[r0]					/* Reset RadioActual to 1 */


	
	/*For multiple Images */
		
	
	LDR r0,=Vueltas				/* Increase Vueltas*/
	LDR r1,[r0]
	ADD r1,#1
	STR r1,[r0]
	


	CMP r1,#4					/* Change the image pointer every 4 laps */
	ITT LO
	LDRLO r8,=Image1
	BLO PintarLeds
	
	
	CMP r1,#8
	ITT LO
	LDRLO r8,=Image2
	BLO PintarLeds
		
	
	CMP r1,#12
	ITT LO
	LDRLO r8,=Image3
	BLO PintarLeds
	
	
	CMP r1,#16
	
	ITT LO
	LDRLO r8,=Image4
	BLO PintarLeds
	
	
	CMP r1,#20
	
	ITTTT LO
	
	LDRLO r0,=Vueltas				/* Increase Vueltas*/
	LDRLO r1,=#0
	STRLO r1,[r0]
	
	LDRLO r8,=Image1
	
	
	/* For one image */
	
	
	@LDR r8,=Image  For one image
	
	
	
	B PintarLeds



/*--------------------------LPTMR subroutine------------------------*/

LPTMR:
	
	LDR r0,= Flag_LPTMR					/* clear Flag_LPTMR*/
	LDR r1,=#0
	STR r1,[r0]
					
										
	LDR r0,=RadioActual					/*Increase RadioActual */ 
	LDR r1, [r0]
	ADD r1,#1
	STR r1,[r0]
	

	LDR r2,=#Radios						/*compare if radioActual is higher than radios of images */
	CMP r1,r2
	BHS ApagarLeds								
			
			
					
	/*------------------------------------------ Paint the radio --------------------------------------*/
	
PintarLeds: 
	LDR r2,=GPIOC_PDOR  		/* The addresses and constants are loaded */
	LDR r3,=GPIOB_PDOR		
	
	LDR r5,=0xFFFFFFFF	
	LDR r6,=0x00000000

	MOV r4,#0            		/* Delay counter for reset sequence */
	
Res:
	
	str r6,[r2]					/* Reset the leds */
    str r6,[r3]	
	ADD r4,#1		
	NOP
	NOP
	NOP
	CMP r4,#170	
	BNE Res
	
	MOV r4,#0 						/* Counter for number of word sended, remember you should send 72 words for radio  */	            
	
SendBytes:	
 	
 	LDR r7,[r8],#4
 	 	
    str r5,[r2]			/* Send 1 to leds*/   	
    str r5,[r3]
    
    nop
    nop			
    nop
	nop

    str r7,[r2]			/* Send Data to leds */
    str r7,[r3]
     
    nop
    nop
    nop
    nop
    
    str r6,[r2]			/* Send 0 to leds*/
    str r6,[r3]
    
    nop
    nop
    nop
    nop
    nop
    
	ADD r4,#1 			
    CMP r4,#72		 
	BNE SendBytes			/* Go to send the next word, if the amount of sent bits has not been completed */
	
	B Sleep		
	
		
	
	
/*------------------------------------------ Paint the radio --------------------------------------*/

ApagarLeds: 


	LDR r2,=GPIOC_PDOR  		/* The addresses and constants are loaded */
	LDR r3,=GPIOB_PDOR		
	
	LDR r5,=0xFFFFFFFF	
	LDR r6,=0x00000000

	MOV r4,#0            		/* Delay counter for reset sequence */
	

Res1:
	
	str r6,[r2]					/* Reset the leds */
    str r6,[r3]	
	ADD r4,#1		
	NOP
	NOP
	NOP
	CMP r4,#170	
	
BNE Res1
	
	
	MOV r4,#0            /* counter for sent words */	
	LDR r7,=0x00000000

SendBytes1:	
					
	
	 		
    str r5,[r2]			/* Send 1 to leds*/
    str r5,[r3]
    
    nop
    nop			
    nop
	nop

    
    str r7,[r2]			/* Send 0 to leds */
    str r7,[r3]
     
    nop
    nop
    nop
    nop
    
    str r6,[r2]			/* Send 0 to leds*/
    str r6,[r3]
    
    nop
    nop
    nop
    nop
    nop
    
	ADD r4,#1 			
    CMP r4,#72		
    
BNE SendBytes1			/* Go to send the next word, if the amount of sent bits has not been completed */
	
	B Sleep			




	/*------------------------------------------ Waiting for interruptions ----------------------------*/


Sleep:	
	WFI
	B MainLoop




		/*----------------------------------- Interruption attention sub-routines ----------------*/
	
	/*----------------------------------------- Hall Sensor interrupt ------------------------------------*/

	
.align 2
.global PORTC_IRQHandler
.type   PORTC_IRQHandler function

PORTC_IRQHandler:

	LDR r0,=PORTC_PCR16
	LDR r1,[r0]
	ORR r1,#0x1000000 
	STR r1,[r0]					/* Clear the interruption */
	
		
	LDR r0,= Flag_Hall			/* Hall_Flag = 1*/
	LDR r1,=#1
	STR r1,[r0]
		
	
	dsb	
	BX lr


	/*---------------------------------------- LPTMR interrupt ----------------------------------------*/


.align 2
.global LPTimer_IRQHandler
.type   LPTimer_IRQHandler function

LPTimer_IRQHandler:

	LDR r0,=LPTMR0_CSR
	LDR r1,[r0]
	
	ORR r1,#0x80  
	STR r1,[r0]					/* Clear the interruption */
	
	
	LDR r0,= Flag_LPTMR			/* LPTMR_FLAG = 1*/
	LDR r1,=#1
	STR r1,[r0]
	
	dsb
BX lr
					  
      
.end
